import Signup from './pages/Signup';
import { VerifyEmail } from './pages/VerifyEmail';

function App() {
  return (
    <div>
     <Navbar/>
     <Routes>
      <Route path="/" element={<Home/>}/>
      <Route path="/signup" element={<Signup/>}/>
      <Route path="/verify-email" element={<VerifyEmail/>}/>
   </Routes>

    </div>

  );
  }





